import { Project } from "../DoData"

interface ProjectListElementProps {
    project: Project
}

const ProjectListElement = ({ project }: ProjectListElementProps) => {
    const message = ` N minutes since ${new Date(project.beginning).toISOString().split('T')[0]}`
    return <li key={project.text}>
        <label>
            <input type='checkbox' />
            {project.text}
        </label>
        <span>{message}</span>
    </li>
}

export default ProjectListElement
